import React from 'react';

const UrlList = ({ urls }) => {
  return (
    <div>
      <h2>URL List</h2>
      <ul>
        {urls.map((url) => (
          <li key={url._id}>
            <a href={url.url} target="_blank" rel="noopener noreferrer">
              {url.name}
            </a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default UrlList;
